import React from 'react';

import Navbar from './components/Navbar';

import CssBaseline from '@mui/material/CssBaseline';
import Container from "@mui/material/Container";
import FormControlLabel from "@mui/material/FormControlLabel";
import Switch from "@mui/material/Switch";
import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';
import Fab from '@mui/material/Fab';
import Stack from '@mui/material/Stack';

import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';

import ThemeProvider from '@mui/material/styles/ThemeProvider';
import createTheme from '@mui/material/styles/createTheme';


// https://m2.material.io/resources/color/#!/?view.left=0&view.right=1&primary.color=1b4972
const lightTheme = createTheme({
  palette: {
    primary: {
      light: '#757ce8',
      main: '#086788',
      dark: '#002884',
      contrastText: "#fff",
    },
    secondary: {
      main: "#77625C",
    },
    background: {
      default: "#fff",
    },
  },
});

// #086788, #07A0C3, #C5C9A4, #8E6E53, #77625C

const darkTheme = createTheme({
  palette: { mode: 'dark' },
});

export default function App(): JSX.Element {
  const [darkMode, setDarkMode] = React.useState(false);

  const handleChange = (event: React.ChangeEvent<HTMLInputElement>): void => {
    setDarkMode(event.target.checked);
  };

  return (
    <ThemeProvider theme={darkMode ? darkTheme : lightTheme}>
      <CssBaseline />

      <Navbar />

      <Paper
        elevation={8}
        sx={{
          width: "100%",
          backgroundColor: '#404040',
          // backgroundImage:
          //   'linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url("./images/drill-with-dog.jpeg")',
          backgroundSize: "cover",
          backgroundPosition: "center center",
        }}
      >
        <Container maxWidth="sm" sx={{ paddingY: 5 }}>
          <Typography variant="h2" color="white" mb={3}>
            Welcome To The Internet
          </Typography>

          <Typography variant="h4" color="white" mb={4}>
            Hold on to your socks, cause a random guy just kindly sent you photos of his drill.
          </Typography>

          <Stack direction="row" justifyContent="center">
            <Fab variant="extended" size="large">
              <KeyboardArrowDownIcon sx={{ mr: 1 }} />
              Get A Free Estimate
            </Fab>
          </Stack>
        </Container>
      </Paper>

      <Container maxWidth="md">
        <FormControlLabel control={<Switch checked={darkMode} onChange={handleChange} />} label="Dark Mode" />

        <Typography variant="h1" color="primary">
          Title
        </Typography>

        <Typography variant="h2">
          Header
        </Typography>

        <Typography paragraph>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Sit amet facilisis magna etiam tempor orci eu lobortis. Nisi est sit amet facilisis magna etiam.
        </Typography>

        <Typography paragraph>
          In iaculis nunc sed augue lacus viverra vitae. Risus ultricies tristique nulla aliquet enim tortor at. Mattis ullamcorper velit sed ullamcorper morbi tincidunt. Velit laoreet id donec ultrices tincidunt arcu non sodales neque. Quam vulputate dignissim suspendisse in est ante. Pellentesque adipiscing commodo elit at imperdiet dui accumsan sit. Sollicitudin tempor id eu nisl nunc mi. Placerat in egestas erat imperdiet sed euismod. Scelerisque eleifend donec pretium vulputate sapien. Luctus accumsan tortor posuere ac ut consequat semper. Vel orci porta non pulvinar neque laoreet suspendisse interdum consectetur. Accumsan lacus vel facilisis volutpat est velit egestas dui id. Volutpat consequat mauris nunc congue. Vitae tempus quam pellentesque nec nam aliquam.
        </Typography>
      </Container>
    </ThemeProvider>
  );
}
